import React from 'react'
import { mdx } from '@mdx-js/react'

/* @jsxRuntime classic */
/* @jsx mdx */
import { Playground, Props } from 'docz';
import 'antd/dist/antd.css';
import TreeCurd, {EditType} from './TreeCurd';
import { Button, Input, Form, Space, message } from 'antd';
import FormUtil from '../utils/FormUtil'


const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "treecurd"
    }}>{`TreeCurd`}</h1>
    <p>{`一个可以自定义树操作的树组件`}</p>
    <h3 {...{
      "id": "主要做了以下工作"
    }}>{`主要做了以下工作`}</h3>
    <ul>
      <li parentName="ul">{`处理树的编辑 新增  删除  编辑`}</li>
      <li parentName="ul">{`处理树的多选`}</li>
    </ul>
    <h3 {...{
      "id": "你可以"
    }}>{`你可以`}</h3>
    <ul>
      <li parentName="ul">{`自定义树编辑区域`}</li>
      <li parentName="ul">{`自定义对树的操作`}</li>
      <li parentName="ul">{`自定义是否可多选`}</li>
    </ul>
    <h2 {...{
      "id": "示例"
    }}>{`示例`}</h2>
    <p>{`涉及网络操作，建议在开发者工具中限制后观察示例`}</p>
    <h2 {...{
      "id": "基本用法"
    }}>{`基本用法`}</h2>
    <Playground __position={0} __code={'class Demo extends React.Component {
    constructor(props) {
      super(props)
      this.formRef = React.createRef()
    }
    render() {
      return (
        <TreeCurd
          getKey="id"
          showSearch
          deleteFunction={ids => message.info(ids)}
          getTreeData={() => {
            return fetch('./').then(() => {
              return [
                {
                  id: '0-0',
                  name: '0-0',
                  children: [
                    {
                      id: '0-0-1',
                      name: '0-0-1',
                    },
                  ],
                },
                {
                  id: '0-1',
                  name: '0-1',
                  children: [
                    {
                      id: '0-1-1',
                      name: '0-1-1',
                    },
                  ],
                },
              ]
            })
          }}
          renderEditExtra={extraData => {
            const { selectedItems, selectedKeys, type, refresh } = extraData
            if (type && this.formRef && this.formRef.current) {
              if (type === EditType.ADD) {
                this.formRef.current.resetFields()
              } else if (type === EditType.EDIT) {
                this.formRef.current.setFieldsValue(selectedItems[0])
              } else {
                this.formRef.current.resetFields()
              }
            }
            return (
              <React.Fragment>
                <Form ref={this.formRef}>
                  {FormUtil.renderFormItems(
                    [
                      {
                        label: '类型',
                        content: (
                          <span>
                            {type === 'add' ? '新增' : type ? '编辑' : ''}
                          </span>
                        ),
                        name: 'type',
                        labelSpan: 3,
                        formItemProps: {
                          children: '',
                          rules: [
                            {
                              required: false,
                            },
                          ],
                        },
                      },
                      {
                        label: '名称',
                        content: <Input />,
                        name: 'name',
                        labelSpan: 3,
                        formItemProps: {
                          children: '',
                          rules: [
                            {
                              required: true,
                            },
                          ],
                        },
                      },
                      {
                        label: '编码',
                        content: <Input />,
                        name: 'id',
                        labelSpan: 3,
                        formItemProps: {
                          children: '',
                          rules: [
                            {
                              required: true,
                            },
                          ],
                        },
                      },
                      {
                        labelSpan: 3,
                        content: (
                          <div className="fb-ControlGroup">
                            <Space>
                              <Button type="primary" htmlType="submit">
                                确定
                              </Button>
                              <Button onClick={refresh}>重置</Button>
                            </Space>
                          </div>
                        ),
                      },
                    ],
                    1,
                  )}
                </Form>
              </React.Fragment>
            )
          }}
        />
      )
    }
  }'} __scope={{
      props: this ? this.props : props,
      Playground,
      Props,
      TreeCurd,
      EditType,
      Button,
      Input,
      Form,
      Space,
      message,
      FormUtil
    }} __codesandbox={`N4IgZglgNgpgziAXKCA7AJjAHgOgBYAuAtlEqAMYD2qBMNSIAPOhAG4AEE6AvADogAnSpQL8AfIwD0LVmJABfADQg0mXACsEyEFRp0CDSQCojvVO3YAVPBDjsAwpUwBlAIYYARpSzs8rux4wdOyuAK4ElESuBBDkrlBQAJ7sAOZ0MALRMOjsoXBoKWYWAAZUmHDu6F5YGcU47ACSYOyJlKEA5AIw7OShAhBtdniUAO7sBH4Evq4ADjPp6IotbT3uRT14MOQA1uxtU20C7OiU5EMZMIi-BAQzcIiSkikQE6EeOFREkmXwldXfTl--TtKZ2ncAh0B3FFJFI9APjgOACIgqwuhgew-kWdgoLPLtLESeZ2Ewo1ZXaD04AEchJEsZjWIEcjJKCaT0AYoiOPYa9wgiVAlgaVAZnCJYADEhSIJZnBmCUYCWI86NcNJ-KwoTqKU9V2EMgQiAAVRiKB7PdSRRPE8JoDgSRXI8rynPtQNJR8-UzXaMFUF0FFjlOXDnAIRIsXYbgOPWKIBGeVArnaAAGdgkxmLB2j3aszM7ApioAFkq9gADZKuq9YwGA_TvWgRJiv4ZxDgRB1MBgoR-Es6hKDgMyEU66tupoZwIFwy52AARkamr5ASpKpgAQTmbL2AjKDyBsKB0DDfiOWysQzujGR2BRTKYG4YA8PS964HkLca2AS7oBu4IADIwfGXiYEoZpgeu27uCRuUwGQyUBlQdp2AAfg2EGwwje6rnh0HUD26spBkKs3zMGFnMwMAwigKZCYep6KeO5dqwsYBWe4R7gBXCxyDguj2C1GAiGHbAQPQOwooIHA12oF1Be5mtheoFE0UlIUI37Sg7nutWNdN17QlhfX0LfM2NYmWwcG6tyxWaHKFY-U1aBdwmhZrcnbYnOgp1Zk2A8Dgg-nMKN1YDxg5JYtjfYD08AGkYESPgVHQfgk9tuBhhGZxxTEvBc7NzBYFofS0e7VBPq4Ox-fYKyKjSHA0G6iMG45f2w4109461aJXE-vmBbL22ugjgRzDAUdLsfD1XxwCY6AjMfcpjvuaynyP2AAbQnvvQ-3sOuGKkrzRKxbT771BvQ20qr5v2-A5JsMrkPrfX41k-f4D8-cpL6X02i_f-Ad75Hgvlfc0oCargNtkoI-28AC68CEH8XQQgv-CDAFPzgcgu-D9oEEO_j_d-dBP6EO3jgjBFg8EgNgWAuhNZIGP0YaQlhfssEYLQdQs2SCyF9xQfwu61D5C91PpODIXEXhniwKiEewAZaZCHgQVwbNaF9wOipOA84ti0HQE2SWcAlh6NgJKbIadEimKhvMJYXRpTwDxJhHKKjXBqNcKIiAzQIwZT4hDfEDsnZEBduwQJ9s4COyMi7D4fQwwEGNqI-hvj_HdCRjlWRBAeLzBwIdLUWoklCO3pE6JzsYBgDiQIBJoZ4Cjn0hAeccsfbFIDphecejOCpOhtlZGWScl_jPFqBolgil0NKSE2JvRqnHj0QQBpTS4AADV4gMgjOYgx2RjFEDgPvEqKCbbgPaVATpWjb4TJiRUqpNSuhzIWddOALSEGSNvi8qRo497RwQYwd2-lMgpCvAQAG3zQqBzAJ9C55SwD_WSabYAoVPLQFqeGAQoVtmPNhWbL-XDf6YrDnBQIUBiqAG8fQA0erMJxYWPQNArhfMpabRgc13DAvpb_NJvScokU7FjXG7RAANpoAPI0sZXHZbywAaP6AET44Vcp2hvPpVIJlqAWWUo5DwylbDippIpTigl85TLuCuEmNVOKQnbLQobe4m9WUawoUVGVxrKVoixFQ1pLCzmsq6AAR1CBALo6AriMxORZPFp9BHWprHw11_8w30pjZS91GDdVErlIAWBVAAPntqrhugQIECuIwbSukpibgdSwjVco2GZpYUm_VdqjUhttqa2gRBzV3CuAmuhtriqVq4U6-ALrw24qjSwr1Pq_UirRMGodzyS1cMjeGuNOKF1cPbeAp