      {class Demo extends React.Component {
        constructor(props) {
          super(props);
          this.formRef = React.createRef();
          this.state = {
            expandedKeys: []
          };
        }

        render() {
          return <TreeCurd getKey='id' deleteFunction={ids => message.info(ids)} defaultExpandedKeys={this.state.expandedKeys} onExpand={expandedKeys => {
            this.setState({
              expandedKeys
            });
          }} getTreeData={() => {
            return fetch('./').then(() => {
              return [{
                id: "0-0",
                name: "0-0",
                children: [{
                  id: "0-0-1",
                  name: "0-0-1"
                }]
              }, {
                id: "0-1",
                name: "0-1",
                children: [{
                  id: "0-1-1",
                  name: "0-1-1"
                }]
              }];
            });
          }} renderEditExtra={extraData => {
            const {
              selectedItems,
              selectedKeys,
              type,
              refresh
            } = extraData;

            if (type && this.formRef && this.formRef.current) {
              if (type === EditType.ADD) {
                this.formRef.current.resetFields();
              } else if (type === EditType.EDIT) {
                this.formRef.current.setFieldsValue(selectedItems[0]);
              } else {
                this.formRef.current.resetFields();
              }
            }

            return <React.Fragment>
                <Form ref={this.formRef} mdxType="Form">
                  {FormUtil.renderFormItems([{
                  label: '类型',
                  content: <span>{type === 'add' ? '新增' : type ? '编辑' : ''}</span>,
                  name: 'type',
                  labelSpan: 3,
                  formItemProps: {
                    children: '',
                    rules: [{
                      required: false
                    }]
                  }
                }, {
                  label: '名称',
                  content: <Input mdxType="Input" />,
                  name: 'name',
                  labelSpan: 3,
                  formItemProps: {
                    children: '',
                    rules: [{
                      required: true
                    }]
                  }
                }, {
                  label: '编码',
                  content: <Input mdxType="Input" />,
                  name: 'id',
                  labelSpan: 3,
                  formItemProps: {
                    children: '',
                    rules: [{
                      required: true
                    }]
                  }
                }, {
                  labelSpan: 3,
                  content: <div className="fb-ControlGroup">
                            <Space mdxType="Space">
                              <Button type="primary" htmlType="submit" mdxType="Button">
                                确定
                              </Button>
                              <Button onClick={refresh} mdxType="Button">重置</Button>
                            </Space>
                          </div>
                }], 1)}
                </Form>
              </React.Fragment>;
          }} renderExtra={(extraData, defaultRender) => {
            return <React.Fragment>
            {defaultRender(extraData)}
            <Button mdxType="Button">自定义按钮</Button>
          </React.Fragment>;
          }} mdxType="TreeCurd" />;
        }

      }}
    </Playground>
    <h2 {...{
      "id": "属性"
    }}>{`属性`}</h2>
    <Props of={TreeCurd} mdxType="Props" />
    </MDXLayout>;
}

